import React from 'react';
import { Link } from 'react-router-dom';


function Home() {
  return (
    <div className="flex flex-col items-center justify-center min-h-[60vh] text-center">
      <h1 className="text-4xl md:text-5xl font-extrabold text-red-500 mb-4">Welcome to Zwiggy</h1>
      <p className="mb-8 text-lg text-gray-600">Order food from your favorite restaurants, fast and easy.</p>
      <div className="space-x-4">
        <Link to="/restaurants" className="bg-red-500 hover:bg-red-600 text-white px-6 py-2 rounded-full font-semibold shadow">View Restaurants</Link>
        <Link to="/login" className="text-red-500 hover:underline font-medium">Login</Link>
        <span className="text-gray-400">|</span>
        <Link to="/register" className="text-red-500 hover:underline font-medium">Register</Link>
      </div>
    </div>
  );
}

export default Home;
